DROP TABLE IF EXISTS `evolution_chain_data`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `evolution_chain_data` (
  `evolution_chain_id` int(11) NOT NULL,
  `species` varchar(45) NOT NULL,
  `is_baby` int(11) DEFAULT NULL,
  `evolves_into_species` varchar(45) NOT NULL,
  `min_level` int(11) DEFAULT NULL,
  `min_beauty` int(11) DEFAULT NULL,
  `time_of_day` varchar(45) DEFAULT NULL,
  `gender` int(11) DEFAULT NULL,
  `relative_physical_stats` int(11) DEFAULT NULL,
  `needs_overworld_rain` int(11) DEFAULT NULL,
  `turn_upside_down` int(11) DEFAULT NULL,
  `item` varchar(45) DEFAULT NULL,
  `evolution_trigger` varchar(45) DEFAULT NULL,
  `known_move_type` varchar(45) DEFAULT NULL,
  `min_affection` int(11) DEFAULT NULL,
  `party_type` varchar(45) DEFAULT NULL,
  `trade_species` varchar(45) DEFAULT NULL,
  `min_happiness` int(11) DEFAULT NULL,
  `held_item` varchar(45) DEFAULT NULL,
  `known_move` varchar(45) DEFAULT NULL,
  `location` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`evolution_chain_id`,`species`,`evolves_into_species`),
  KEY `fk_evolution_species_idx` (`species`),
  KEY `fk_evolution_into_species_idx` (`evolves_into_species`),
  KEY `fk_evolution_item_idx` (`item`),
  KEY `fk_evolution_trigger_idx` (`evolution_trigger`),
  KEY `fk_evolution_move_type_idx` (`known_move_type`),
  KEY `fk_evolution_party_type_idx` (`party_type`),
  KEY `fk_evolution_trade_species_idx` (`trade_species`),
  KEY `fk_evolution_known_move_idx` (`known_move`),
  KEY `fk_evolution_held_item_idx` (`held_item`),
  CONSTRAINT `fk_evolution_chain_id` FOREIGN KEY (`evolution_chain_id`) REFERENCES `evolution_chain` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_held_item` FOREIGN KEY (`held_item`) REFERENCES `item` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_into_species` FOREIGN KEY (`evolves_into_species`) REFERENCES `pokemon_species` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_item` FOREIGN KEY (`item`) REFERENCES `item` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_known_move` FOREIGN KEY (`known_move`) REFERENCES `move` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_move_type` FOREIGN KEY (`known_move_type`) REFERENCES `pokemon_type` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_party_type` FOREIGN KEY (`party_type`) REFERENCES `pokemon_type` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_species` FOREIGN KEY (`species`) REFERENCES `pokemon_species` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_trade_species` FOREIGN KEY (`trade_species`) REFERENCES `pokemon_species` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_evolution_trigger` FOREIGN KEY (`evolution_trigger`) REFERENCES `evolution_trigger` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
