  CONSTRAINT `fk_item_category` FOREIGN KEY (`category`) REFERENCES `item_category` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_item_fling_effect` FOREIGN KEY (`fling_effect`) REFERENCES `item_fling_effect` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION
