INSERT INTO `pokemon_ability` VALUES (91,'adaptability','Adaptability','Powers up moves of the\nsame type as the Pokémon.','This Pokémon inflicts twice as much damage with moves whose types match its own, rather than the usual same-type attack bonus of 1.5×.'),(184,'aerilate','Aerilate','Normal-type moves become\nFlying-type moves.','Turns the bearer\'s normal-type moves into flying-type moves.  Moves changed by this ability have 1.3× their power.'),(106,'aftermath','Aftermath','Damages the attacker\nlanding the finishing hit.','When this Pokémon is knocked out by a move that makes contact, the move\'s user takes 1/4 its maximum HP in damage.'),(76,'air-lock','Air Lock','Eliminates the effects of\nweather.','While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.\n\nThis ability functions identically to cloud nine.'),(148,'analytic','Analytic','Boosts move power when the\nPokémon moves after the target.','This Pokémon\'s moves have 1.3× their power when it moves last in a turn.\n\nfuture sight and doom desire are unaffected.'),(83,'anger-point','Anger Point','Maxes the Attack stat after\nthe Pokémon takes a critical hit.','Whenever this Pokémon receives a critical hit, its Attack rises to the maximum of 6 stages.\n\nThis ability will still take effect if the critical hit is received by a substitute.'),(107,'anticipation','Anticipation','Senses an opposing Pokémon’s\ndangerous moves.','When this Pokémon enters battle, if one of its opponents has a move that is super effective against it, self destruct, explosion, or a one-hit knockout move, all participating trainers are notified.\n\nThe move itself is not revealed; only that there is such a move.  Moves that inflict typeless damage, such as future sight, and moves of variable type, such as hidden power, count as their listed types.  counter, metal burst, mirror coat, and one-hit KO moves to which this Pokémon is immune do not trigger this ability.'),(10055,'aqua-boost','Aqua Boost',NULL,NULL),(71,'arena-trap','Arena Trap','Prevents opposing Pokémon\nfrom fleeing.','While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.  flying-type Pokémon and Pokémon in the air, e.g. due to levitate or magnet rise, are unaffected.\n\nPokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.'),(165,'aroma-veil','Aroma Veil','Protects allies from attacks that\nlimit their move choices.','Protects allies against moves that affect their mental state.'),(188,'aura-break','Aura Break','The effects of “Aura” Abilities\nare reversed.','While this Pokémon is on the field, dark aura and fairy aura weaken moves of their respective types to 2/3 their power, rather than strengthening them.'),(123,'bad-dreams','Bad Dreams','Reduces the HP of sleeping\nopposing Pokémon.','Opposing Pokémon take 1/8 of their maximum HP in damage after each turn while they are asleep.'),(4,'battle-armor','Battle Armor','Protects the Pokémon\nfrom critical hits.','Moves cannot score critical hits against this Pokémon.\n\nThis ability functions identically to shell armor.'),(145,'big-pecks','Big Pecks','Protects the Pokémon from\nDefense-lowering attacks.','This Pokémon\'s Defense cannot be lowered by other Pokémon.\n\nThis Pokémon can still be passed negative Defense modifiers through heart swap or guard swap.'),(10048,'black-hole','Black Hole',NULL,NULL),(66,'blaze','Blaze','Powers up Fire-type moves when\nthe Pokémon is in trouble.','When this Pokémon has 1/3 or less of its HP remaining, its fire-type moves inflict 1.5× as much regular damage.'),(10027,'bodyguard','Bodyguard',NULL,NULL),(10044,'bonanza','Bonanza',NULL,NULL),(171,'bulletproof','Bulletproof','Protects the Pokémon from\nsome ball and bomb moves.','Protects against bullet, ball, and bomb-based moves.'),(10037,'calming','Calming',NULL,NULL),(10035,'celebrate','Celebrate',NULL,NULL),(167,'cheek-pouch','Cheek Pouch','Restores HP as well when\nthe Pokémon eats a Berry.','Restores HP upon eating a Berry, in addition to the Berry\'s effect.'),(34,'chlorophyll','Chlorophyll','Boosts the Pokémon’s\nSpeed stat in sunshine.','This Pokémon\'s Speed is doubled during strong sunlight.\n\nThis bonus does not count as a stat modifier.'),(29,'clear-body','Clear Body','Prevents other Pokémon\nfrom lowering its stats.','This Pokémon cannot have its stats lowered by other Pokémon.\n\nThis ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis.  This Pokémon can still be passed negative stat modifiers through guard swap, heart swap, or power swap.\n\nThis ability functions identically to white smoke in battle.'),(10053,'climber','Climber',NULL,NULL),(13,'cloud-nine','Cloud Nine','Eliminates the effects of\nweather.','While this Pokémon is in battle, weather can still be in play, but will not have any of its effects.\n\nThis ability functions identically to air lock.'),(16,'color-change','Color Change','The Pokémon’s type becomes\nthe type of the move used on it.','Whenever this Pokémon takes damage from a move, the Pokémon\'s type changes to match the move.\n\nIf the Pokémon has two types, both are overridden.  The Pokémon must directly take damage; for example, moves blocked by a substitute will not trigger this ability, nor will moves that deal damage indirectly, such as spikes.\n\nThis ability takes effect on only the last hit of a multiple-hit attack.\n\nIn Pokémon Colosseum and XD: Gale of Darkness, this ability does not take effect on Shadow-type moves.'),(172,'competitive','Competitive','Boosts the Sp. Atk stat when\na stat is lowered.','Raises Special Attack by two stages upon having any stat lowered.'),(14,'compound-eyes','Compound Eyes','Boosts the Pokémon’s accuracy.','This Pokémon\'s moves have 1.3× their accuracy.\n\nThis ability has no effect on the one-hit KO moves (fissure, guillotine, horn drill, and sheer cold).\n\nOverworld: If the first Pokémon in the party has this ability, the chance of a wild Pokémon holding a particular item is raised from 50%, 5%, or 1% to 60%, 20%, or 5%, respectively.'),(10042,'confidence','Confidence',NULL,NULL),(10057,'conqueror','Conqueror',NULL,NULL),(126,'contrary','Contrary','Makes stat changes have\nan opposite effect.','Whenever this Pokémon\'s stats would be raised, they are instead lowered by the same amount, and vice versa.'),(130,'cursed-body','Cursed Body','May disable a move used\non the Pokémon.','Moves that hit this Pokémon have a 30% chance of being Disabled afterward.'),(56,'cute-charm','Cute Charm','Contact with the Pokémon\nmay cause infatuation.','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being infatuated.\n\nOverworld: If the first Pokémon in the party has this ability, any wild Pokémon whose species can be either gender has a 2/3 chance of being set to the opposite gender, and a 1/3 chance of having a random gender as usual.'),(6,'damp','Damp','Prevents the use of\nself-destructing moves.','While this Pokémon is in battle, self destruct and explosion will fail and aftermath will not take effect.'),(186,'dark-aura','Dark Aura','Powers up each Pokémon’s\nDark-type moves.','Strengthens dark moves for all friendly and opposing Pokémon.'),(10038,'daze','Daze',NULL,NULL),(10059,'decoy','Decoy',NULL,NULL),(10013,'deep-sleep','Deep Sleep',NULL,NULL),(129,'defeatist','Defeatist','Lowers stats when HP\nbecomes half or less.','This Pokémon\'s Attack and Special Attack are halved when it has half its HP or less.'),(128,'defiant','Defiant','Boosts the Pokémon’s Attack stat\nwhen its stats are lowered.','When any of this Pokémon\'s stats are lowered, its Attack rises by two stages.\n\nIf multiple stats are lowered at once, this ability takes effect with each stat lowered.'),(191,'delta-stream','Delta Stream',NULL,NULL),(190,'desolate-land','Desolate Land',NULL,NULL),(10051,'disgust','Disgust',NULL,NULL),(10008,'dodge','Dodge',NULL,NULL),(88,'download','Download','Adjusts power based on an\nopposing Pokémon’s stats.','When this Pokémon enters battle, its Attack or Special Attack, whichever corresponds to its opponents\' weaker total defensive stat, rises one stage.  In the event of a tie, Special Attack is raised.\n\nThis ability also takes effect when acquired during a battle.'),(2,'drizzle','Drizzle','The Pokémon makes it rain\nwhen it enters a battle.','The weather changes to rain when this Pokémon enters battle and does not end unless replaced by another weather condition.\n\nIf multiple Pokémon with this ability, drought, sand stream, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.'),(70,'drought','Drought','Turns the sunlight harsh when\nthe Pokémon enters a battle.','The weather changes to strong sunlight when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, sand stream, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.'),(87,'dry-skin','Dry Skin','Reduces HP if it’s hot.\nWater restores HP.','This Pokémon takes 1/8 of its maximum HP in damage after each turn during strong sunlight, but it heals for 1/8 of its HP each turn during rain.  This Pokémon takes 1.25× as much damage from fire-type moves, but whenever a water move hits it, it heals for 1/4 its maximum HP instead.'),(48,'early-bird','Early Bird','The Pokémon awakens\nquickly from sleep.','This Pokémon\'s remaining sleep turn count falls by 2 rather than 1.\n\nIf this Pokémon\'s sleep counter is at 1, it will fall to 0 and then the Pokémon will wake up.'),(27,'effect-spore','Effect Spore','Contact may poison or\ncause paralysis or sleep.','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being paralyzed, poisoned, or put to sleep, chosen at random.\n\nNothing is done to compensate if the move\'s user is immune to one of these ailments; there is simply a lower chance that the move\'s user will be affected.'),(10045,'explode','Explode',NULL,NULL),(187,'fairy-aura','Fairy Aura','Powers up each Pokémon’s\nFairy-type moves.','Strengthens fairy moves for all friendly and opposing Pokémon.'),(111,'filter','Filter','Reduces damage from\nsupereffective attacks.','This Pokémon takes 0.75× as much damage from moves that are super effective against it.\n\nThis ability functions identically to solid rock.'),(49,'flame-body','Flame Body','Contact with the Pokémon\nmay burn the attacker.','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being burned.\n\nOverworld: If any Pokémon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly.  This effect does not stack if multiple Pokémon have this ability or magma armor.'),(10054,'flame-boost','Flame Boost',NULL,NULL),(138,'flare-boost','Flare Boost','Powers up special attacks when\nthe Pokémon is burned.','This Pokémon has 1.5× its Special Attack when burned.'),(18,'flash-fire','Flash Fire','Powers up the Pokémon’s Fire-\ntype moves if it’s hit by one.','This Pokémon is immune to fire-type moves.  Once this Pokémon has been hit by a Fire move, its own Fire moves will inflict 1.5× as much damage until it leaves battle.\n\nThis ability has no effect while the Pokémon is frozen.  The Fire damage bonus is retained even if the Pokémon is frozen and thawed or the ability is lost or disabled.  Fire moves will ignore this Pokémon\'s substitute.  This ability takes effect even on non-damaging moves, i.e. will o wisp.'),(122,'flower-gift','Flower Gift','Powers up party Pokémon\nwhen it is sunny.','Friendly Pokémon have 1.5× their Attack and Special Defense during strong sunlight if any friendly Pokémon has this ability.\n\nUnlike forecast, multitype, and zen mode, this ability is not tied to its Pokémon\'s form change; cherrim will switch between its forms even if it loses this ability.  As such, this ability also works if obtained by a Pokémon other than Cherrim.'),(166,'flower-veil','Flower Veil','Prevents lowering of ally\nGrass-type Pokémon’s stats.','Protects friendly grass Pokémon from having their stats lowered by other Pokémon.'),(59,'forecast','Forecast','Castform transforms with\nthe weather.','During rain, strong sunlight, or hail, this Pokémon\'s type changes to water, fire, or ice, respectively, and its form changes to match.\n\nThis ability has no effect for any Pokémon other than castform.\n\nIf the weather ends or becomes anything that does not trigger this ability, or a Pokémon with air lock or cloud nine enters battle, this Pokémon\'s type and form revert to their default.  If this ability is lost or disabled, this Pokémon cannot change its current type and form until it regains its ability.'),(108,'forewarn','Forewarn','Determines what moves\nan opposing Pokémon has.','When this Pokémon enters battle, it reveals the move with the highest base power known by any opposing Pokémon to all participating trainers.\n\nIn the event of a tie, one is chosen at random.\n\nMoves without a listed base power are assigned one as follows:\n\nPower | Moves\n----: | -----\n  160 | One-hit KO moves: fissure, guillotine, horn drill, and sheer cold\n  120 | Counter moves: counter, metal burst, and mirror coat\n   80 | Variable power or set damage: crush grip, dragon rage, electro ball, endeavor, final gambit, flail, frustration, grass knot, gyro ball, heat crash, heavy slam, hidden power, low kick, natural gift, night shade, psywave, return, reversal, seismic toss, sonic boom, trump card, and wring out\n    0 | Any such move not listed\n'),(10043,'fortune','Fortune',NULL,NULL),(132,'friend-guard','Friend Guard','Reduces damage done\nto allies.','All friendly Pokémon take 0.75× as much direct damage from moves while this Pokémon is in battle.\n\nThis effect stacks if multiple allied Pokémon have it.'),(10039,'frighten','Frighten',NULL,NULL),(119,'frisk','Frisk','The Pokémon can check an\nopposing Pokémon’s held item.','When this Pokémon enters battle, it reveals an opposing Pokémon\'s held item to all participating trainers.\n\nIn a double battle, if one opponent has an item, this Pokémon will Frisk that Pokémon; if both have an item, it will Frisk one at random.'),(10010,'frostbite','Frostbite',NULL,NULL),(169,'fur-coat','Fur Coat','Halves damage from\nphysical moves.','Halves damage from physical attacks.'),(177,'gale-wings','Gale Wings','Gives priority to Flying-type\nmoves.','Raises flying moves\' priority by one stage.'),(82,'gluttony','Gluttony','Makes the Pokémon use a held\nBerry earlier than usual.','This Pokémon eats any held Berry triggered by low HP when it falls below 50% of its HP, regardless of the Berry\'s usual threshold.'),(183,'gooey','Gooey','Contact with the Pokémon\nlowers the attacker’s Speed stat.','Lowers attacking Pokémon\'s Speed by one stage on contact.'),(10034,'grass-cloak','Grass Cloak',NULL,NULL),(179,'grass-pelt','Grass Pelt','Boosts the Defense stat\nin Grassy Terrain.','Boosts Defense while grassy terrain is in effect.'),(10017,'gulp','Gulp',NULL,NULL),(62,'guts','Guts','Boosts the Attack stat if the\nPokémon has a status condition.','Whenever this Pokémon is asleep, burned, paralyzed, or poisoned, it has 1.5× its Attack.  This Pokémon is not affected by the usual Attack cut from a burn.\n\nThis bonus does not count as a stat modifier.'),(139,'harvest','Harvest','May create another\nBerry after one is used.','After each turn, if the last item this Pokémon consumed was a Berry and it is not currently holding an item, it has a 50% chance of regaining that Berry, or a 100% chance during strong sunlight.'),(131,'healer','Healer','Sometimes heals an\nally’s status condition.','Friendly Pokémon next to this Pokémon in double and triple battles each have a 30% chance of being cured of any major status ailment after each turn.'),(85,'heatproof','Heatproof','Weakens the power of\nFire-type moves.','This Pokémon takes half as much damage from fire-type moves and burns.'),(134,'heavy-metal','Heavy Metal','Doubles the Pokémon’s weight.','This Pokémon has double the usual weight for its species.'),(10018,'herbivore','Herbivore',NULL,NULL),(10028,'hero','Hero',NULL,NULL),(10052,'high-rise','High-rise',NULL,NULL),(118,'honey-gather','Honey Gather','The Pokémon may gather\nHoney from somewhere.','This Pokémon has a chance of picking up honey after each battle.  This chance starts at 5% and rises another 5% after every tenth level: 5% from level 1–10, 10% from 11–20, and so on, up to 50% from 91–100.\n\nThis ability is checked after the battle ends, at which point any temporary ability changes have worn off.'),(10020,'hot-blooded','Hot Blooded',NULL,NULL),(37,'huge-power','Huge Power','Boosts the Pokémon’s\nAttack stat.','This Pokémon\'s Attack is doubled while in battle.\n\nThis bonus does not count as a stat modifier.\n\nThis ability functions identically to pure power.'),(55,'hustle','Hustle','Boosts the Attack stat,\nbut lowers accuracy.','This Pokémon\'s physical moves do 1.5× as much regular damage, but have 0.8× their usual accuracy.\n\nSpecial moves are unaffected.  Moves that do set damage, such as seismic toss, have their accuracy affected, but not their damage.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.'),(93,'hydration','Hydration','Heals status conditions if\nit’s raining.','This Pokémon is cured of any major status ailment after each turn during rain.'),(52,'hyper-cutter','Hyper Cutter','Prevents other Pokémon\nfrom lowering its Attack stat.','This Pokémon\'s Attack cannot be lowered by other Pokémon.\n\nThis ability does not prevent any Attack losses other than stat modifiers, such as the Attack cut from a burn.  This Pokémon can still be passed negative Attack modifiers through heart swap or power swap.'),(115,'ice-body','Ice Body','The Pokémon gradually\nregains HP in a hailstorm.','This Pokémon heals for 1/16 of its maximum HP after each turn during hail, and it does not take hail damage regardless of type.'),(35,'illuminate','Illuminate','Raises the likelihood of\nmeeting wild Pokémon.','Overworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.\n\nThis ability has no effect in battle.'),(149,'illusion','Illusion','Comes out disguised as the\nPokémon in the party’s last spot.','This Pokémon, upon being sent out, appears to have the species, nickname, and Poké Ball of the last Pokémon in the party that is able to battle.  This illusion breaks upon being hit by a damaging move.\n\nOther damage, e.g. from weather or spikes, does not break the illusion, nor does damage done to a substitute.\n\nIf the party order becomes temporarily shuffled around as Pokémon are switched out in battle, this ability chooses the last Pokémon according to that shuffled order.'),(17,'immunity','Immunity','Prevents the Pokémon\nfrom getting poisoned.','This Pokémon cannot be poisoned.  This includes bad poison.\n\nIf a Pokémon is poisoned and acquires this ability, its poison is healed; this includes when regaining a lost ability upon leaving battle.'),(150,'imposter','Imposter','The Pokémon transforms itself\ninto the Pokémon it’s facing.','This Pokémon transforms into a random opponent upon entering battle.  This effect is identical to the move transform.'),(151,'infiltrator','Infiltrator','Passes through the opposing\nPokémon’s barrier and strikes.','This Pokémon\'s moves ignore light screen, reflect, and safeguard.'),(39,'inner-focus','Inner Focus','Protects the Pokémon\nfrom flinching.','This Pokémon cannot flinch.'),(15,'insomnia','Insomnia','Prevents the Pokémon\nfrom falling asleep.','This Pokémon cannot be asleep.\n\nThis causes rest to fail altogether.  If a Pokémon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.\n\nThis ability functions identically to vital spirit in battle.'),(10007,'instinct','Instinct',NULL,NULL),(10040,'interference','Interference',NULL,NULL),(22,'intimidate','Intimidate','Lowers the opposing Pokémon’s\nAttack stat.','When this Pokémon enters battle, the opponent\'s Attack is lowered by one stage.  In a double battle, both opponents are affected.\n\nThis ability also takes effect when acquired during a battle, but will not take effect again if lost and reobtained without leaving battle.\n\nThis ability has no effect on an opponent that has a substitute.\n\nOverworld: If the first Pokémon in the party has this ability, any random encounter with a Pokémon five or more levels lower than it has a 50% chance of being skipped.'),(160,'iron-barbs','Iron Barbs','Inflicts damage to the\nattacker on contact.','Whenever a move makes contact with this Pokémon, the move\'s user takes 1/8 of its maximum HP in damage.\n\nThis ability functions identically to rough skin.'),(89,'iron-fist','Iron Fist','Powers up punching moves.','Moves flagged as being punch-based have 1.2× their base power for this Pokémon.\n\nsucker punch is not flagged as punch-based; its original, Japanese name only means \"surprise attack\".'),(10009,'jagged-edge','Jagged Edge',NULL,NULL),(154,'justified','Justified','Boosts the Attack stat when\nit’s hit by a Dark-type move.','Whenever a dark-type move hits this Pokémon, its Attack rises one stage.\n\nThe move is not negated in any way.'),(51,'keen-eye','Keen Eye','Prevents other Pokémon\nfrom lowering accuracy.','This Pokémon cannot have its accuracy lowered.\n\nThis ability does not prevent any accuracy losses other than stat modifiers, such as the accuracy cut from fog; nor does it prevent other Pokémon\'s evasion from making this Pokémon\'s moves less accurate.  This Pokémon can still be passed negative accuracy modifiers through heart swap.\n\nOverworld: If the first Pokémon in the party has this ability, any random encounter with a Pokémon five or more levels lower than it has a 50% chance of being skipped.'),(103,'klutz','Klutz','The Pokémon can’t use\nany held items.','In battle, this Pokémon cannot use its held item, nor will the item have any passive effect on the battle, positive or negative.  This Pokémon also cannot use fling.\n\nThe Speed cut from the iron ball and the effort items (the macho brace, power weight, power bracer, power belt, power lens, power band, and power anklet) is unaffected.  Items that do not directly affect the battle, such as the exp share, the amulet coin, or the soothe bell, work as usual.  All held items work as usual out of battle.\n\nOther moves that use the held item, such as natural gift and switcheroo, work as usual.'),(10029,'last-bastion','Last Bastion',NULL,NULL),(102,'leaf-guard','Leaf Guard','Prevents status conditions\nin sunny weather.','This Pokémon cannot be given a major status ailment during strong sunlight.\n\nThis ability does not heal prior status ailments.  rest will fail altogether with this ability in effect.  yawn will immediately fail if used on this Pokémon during strong sunlight, and an already-used Yawn will fail if the weather turns to strong sunlight in the meantime.'),(26,'levitate','Levitate','Gives full immunity to all\nGround-type moves.','This Pokémon is immune to ground-type moves, spikes, toxic spikes, and arena trap.\n\nThis ability is disabled during gravity or ingrain, or while holding an iron ball.  This ability is not disabled during roost.'),(10022,'life-force','Life Force',NULL,NULL),(135,'light-metal','Light Metal','Halves the Pokémon’s weight.','This Pokémon has half the usual weight for its species.'),(31,'lightning-rod','Lightning Rod','Draws in all Electric-type moves\nto boost its Sp. Atk stat.','All other Pokémon\'s single-target electric-type moves are redirected to this Pokémon if it is an eligible target.  Other Pokémon\'s Electric moves raise this Pokémon\'s Special Attack one stage, negating any other effect on it, and cannot miss it.\n\nIf the move\'s intended target also has this ability, the move is not redirected.  When multiple Pokémon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokémon.  follow me takes precedence over this ability.\n\nIf the Pokémon is a ground-type and thus immune to Electric moves, its immunity prevents the Special Attack boost.'),(7,'limber','Limber','Protects the Pokémon\nfrom paralysis.','This Pokémon cannot be paralyzed.\n\nIf a Pokémon is paralyzed and acquires this ability, its paralysis is healed; this includes when regaining a lost ability upon leaving battle.'),(64,'liquid-ooze','Liquid Ooze','Damages attackers\nusing any draining move.','Whenever a Pokémon would heal after hitting this Pokémon with a leeching move like absorb, it instead loses as many HP as it would usually gain.\n\ndream eater is unaffected.'),(10036,'lullaby','Lullaby',NULL,NULL),(10023,'lunchbox','Lunchbox',NULL,NULL),(156,'magic-bounce','Magic Bounce','Reflects status moves.','When this Pokémon is targeted by a move flagged as being reflectable, the move is redirected to its user.\n\nAll reflectable moves are non-damaging, and most non-damaging moves that target other Pokémon are reflectable.\n\nA move reflected by this ability or magic coat cannot be reflected back.'),(98,'magic-guard','Magic Guard','The Pokémon only takes\ndamage from attacks.','This Pokémon is immune to damage not directly caused by a move.\n\nFor example, this Pokémon takes no damage from from weather, recoil, status ailments, or spikes, but it still suffers from the Attack cut when burned, and a life orb will still power up this Pokémon\'s moves without damaging it.  Anything that directly depends on such damage will also not happen; for example, leech seed will neither hurt this Pokémon nor heal the opponent, and Pokémon with a jaboca berry or rowap berry will not consume the berry when hit by this Pokémon.\n\nThe following are unaffected: struggle, pain split (whether used by or against this Pokémon), belly drum, substitute, curse, moves that knock the user out, and damage from confusion.\n\nThis Pokémon will neither lose nor regain HP if it drains HP from a Pokémon with liquid ooze.\n\nIf this Pokémon is badly poisoned, the poison counter is still increased each turn; if the Pokémon loses this ability, it will begin taking as much damage as it would be if it had been taking increasing damage each turn.'),(170,'magician','Magician','The Pokémon steals the held item\nof a Pokémon it hits with a move.','Steals the target\'s held item when the bearer uses a damaging move.'),(40,'magma-armor','Magma Armor','Prevents the Pokémon\nfrom becoming frozen.','This Pokémon cannot be frozen.\n\nIf a Pokémon is frozen and acquires this ability, it will immediately thaw out; this includes when regaining a lost ability upon leaving battle.\n\nOverworld: If any Pokémon in the party has this ability, each egg in the party has its hatch counter decreased by 2 (rather than 1) each step cycle, making eggs hatch roughly twice as quickly.  This effect does not stack if multiple Pokémon have this ability or flame body.'),(42,'magnet-pull','Magnet Pull','Prevents Steel-type\nPokémon from escaping.','While this Pokémon is in battle, opposing steel-type Pokémon cannot flee or switch out.\n\nPokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.\n\nOverworld: If the lead Pokémon has this ability, Steel-type Pokémon have a higher encounter rate.'),(63,'marvel-scale','Marvel Scale','Boosts the Defense stat if the\nPokémon has a status condition.','Whenever this Pokémon has a major status ailment, it has 1.5× its Defense.\n\nThis bonus does not count as a stat modifier.'),(10021,'medic','Medic',NULL,NULL),(178,'mega-launcher','Mega Launcher','Powers up aura and pulse moves.','Strengthens aura and pulse moves to 1.5× their power.'),(10025,'melee','Melee',NULL,NULL),(58,'minus','Minus','Boosts the Sp. Atk stat if another\nPokémon has Plus or Minus.','This Pokémon has 1.5× its Special Attack if any friendly Pokémon has plus or minus.\n\nThis bonus does not count as a stat modifier.  If either ability is disabled by gastro acid, both lose their effect.'),(104,'mold-breaker','Mold Breaker','Moves can be used on the target\nregardless of its Abilities.','This Pokémon\'s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon\'s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon\'s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move\'s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon\'s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon\'s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to teravolt and turboblaze.'),(10041,'mood-maker','Mood Maker',NULL,NULL),(141,'moody','Moody','Raises one stat and\nlowers another.','After each turn, one of this Pokémon\'s stats at random rises two stages, and another falls one stage.\n\nIf a stat is already at 6 or -6 stages, it will not be chosen to be increased or decreased, respectively.'),(78,'motor-drive','Motor Drive','Boosts the Speed stat when it’s\nhit by an Electric-type move.','Whenever an electric-type move hits this Pokémon, its Speed rises one stage, negating any other effect on it.\n\nThis ability will not take effect if this Pokémon is immune to Electric moves.  Electric moves will ignore this Pokémon\'s substitute.\n\nThis effect includes non-damaging moves, i.e. thunder wave.'),(10001,'mountaineer','Mountaineer',NULL,NULL),(153,'moxie','Moxie','Boosts the Attack stat after\nknocking out any Pokémon.','This Pokémon\'s Attack rises one stage upon knocking out another Pokémon, even a friendly Pokémon.\n\nThis ability does not take effect when the Pokémon indirectly causes another Pokémon to faint, e.g. through poison or spikes.\n\nIf this Pokémon knocks out a Pokémon with mummy, the former\'s ability will change without taking effect.'),(136,'multiscale','Multiscale','Reduces damage the Pokémon\ntakes when its HP is full.','This Pokémon takes half as much damage when it is hit having full HP.'),(121,'multitype','Multitype','Changes the Pokémon’s type\nto match the Plate it holds.','If this Pokémon is holding an elemental Plate, its type and form change to match the Plate.\n\nThis Pokémon\'s held item, whether or not it is a Plate, cannot be taken by covet or thief, nor removed by knock off, nor traded by switcheroo or trick.  Covet, Thief, and Knock Off still inflict damage against this Pokémon.  Unlike with sticky hold, this Pokémon cannot use fling, Switcheroo, or Trick to lose its item itself, nor gain an item through Switcheroo or Trick if it does not have one.\n\nThis ability has no effect for any Pokémon other than arceus.  This ability cannot be traded with skill swap, nor copied with role play or trace, nor disabled with gastro acid, nor changed with worry seed.  This Pokémon cannot use Skill Swap or Role Play to lose its ability itself.  mold breaker cannot ignore this ability.\n\nIf a Pokémon Transforms into an Arceus with this ability, it will Transform into Arceus\'s default, normal-type form.  If the Transforming Pokémon is holding a Plate, this ability will then activate and change the Pokémon into the corresponding form.'),(152,'mummy','Mummy','Contact with the Pokémon\nspreads this Ability.','Whenever a contact move hits this Pokémon, the attacking Pokémon\'s ability changes to Mummy.\n\nmultitype is unaffected.  If a Pokémon with moxie knocks this Pokémon out, the former\'s ability will change without taking effect.'),(30,'natural-cure','Natural Cure','All status conditions heal when\nthe Pokémon switches out.','This Pokémon is cured of any major status ailment when it is switched out for another Pokémon.\n\nIf this ability is acquired during battle, the Pokémon is cured upon leaving battle before losing the temporary ability.'),(99,'no-guard','No Guard','Ensures attacks by or\nagainst the Pokémon land.','Moves used by or against this Pokémon never miss.\n\nOne-hit KO moves are unaffected.  Moves affected by this ability can hit Pokémon during the preparation turn of moves like dig or fly.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is doubled.'),(10032,'nomad','Nomad',NULL,NULL),(96,'normalize','Normalize','All the Pokémon’s moves\nbecome Normal type.','This Pokémon\'s moves all act as if they were normal-type.\n\nMoves that inflict typeless damage do so as usual.  Moves of variable type, such as hidden power, are affected.  They otherwise work as usual, however; weather ball, for example, is always forced to be Normal, but it still has doubled power and looks different during weather.\n\nAs thunder wave is prevented by immunities, unlike most non-damaging moves, it does not affect ghost-type Pokémon under the effect of this ability.'),(10024,'nurse','Nurse',NULL,NULL),(12,'oblivious','Oblivious','Keeps the Pokémon from being\ninfatuated or falling for taunts.','This Pokémon cannot be infatuated and is immune to captivate.\n\nIf a Pokémon is infatuated and acquires this ability, its infatuation is cleared.'),(10046,'omnipotent','Omnipotent',NULL,NULL),(142,'overcoat','Overcoat','Protects the Pokémon from things\nlike sand, hail, and powder.','This Pokémon does not take damage from weather.'),(65,'overgrow','Overgrow','Powers up Grass-type moves\nwhen the Pokémon is in trouble.','When this Pokémon has 1/3 or less of its HP remaining, its grass-type moves inflict 1.5× as much regular damage.'),(20,'own-tempo','Own Tempo','Prevents the Pokémon\nfrom becoming confused.','This Pokémon cannot be confused.\n\nIf a Pokémon is confused and acquires this ability, its confusion will immediately be healed.'),(185,'parental-bond','Parental Bond','Parent and child\nattack together.','Lets the bearer hit twice with damaging moves.  The second hit has half power.'),(10006,'parry','Parry',NULL,NULL),(10005,'perception','Perception',NULL,NULL),(124,'pickpocket','Pickpocket','Steals an item from an attacker\nthat made direct contact.','Whenever a move makes contact with this Pokémon, if it does not have a held item, it steals the attacker\'s held item.\n\nThis Pokémon cannot steal upon being knocked out.  It can steal if the attacker has a substitute, but cannot steal when its own Substitute is hit.  If 