Pokémon\'s non-damaging moves have their priority increased by one stage.'),(46,'pressure','Pressure','The Pokémon raises opposing\nPokémon’s PP usage.','Moves targetting this Pokémon use one extra PP.\n\nThis ability stacks if multiple targets have it.  This ability still affects moves that fail or miss.  This ability does not affect ally moves that target either the entire field or just its side, nor this Pokémon\'s self-targetted moves; it does, however, affect single-targetted ally moves aimed at this Pokémon, ally moves that target all other Pokémon, and opponents\' moves that target the entire field.  If this ability raises a move\'s PP cost above its remaining PP, it will use all remaining PP.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.'),(10012,'pride','Pride',NULL,NULL),(189,'primordial-sea','Primordial Sea',NULL,NULL),(168,'protean','Protean','Changes the Pokémon’s type to\nthe type of the move it’s using.','Changes the bearer\'s type to match each move it uses.\n\nThe type change takes place just before the move is used.'),(74,'pure-power','Pure Power','Boosts the Pokémon’s\nAttack stat.','This Pokémon\'s Attack is doubled in battle.\n\nThis bonus does not count as a stat modifier.\n\nThis ability functions identically to huge power.'),(95,'quick-feet','Quick Feet','Boosts the Speed stat if the\nPokémon has a status condition.','Whenever this Pokémon has a major status ailment, it has 1.5× its Speed.  This Pokémon is not affected by the usual Speed cut from paralysis.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved.'),(44,'rain-dish','Rain Dish','The Pokémon gradually\nregains HP in rain.','This Pokémon heals for 1/16 of its maximum HP after each turn during rain.'),(155,'rattled','Rattled','Some move types scare\nit and boost its Speed stat.','This 