eel-type moves have 1.3× their base power.  This Pokémon does not take sandstorm damage, regardless of type.'),(146,'sand-rush','Sand Rush','Boosts the Pokémon’s\nSpeed stat in a sandstorm.','This Pokémon\'s Speed is doubled during a sandstorm, and it does not take sandstorm damage, regardless of type.'),(45,'sand-stream','Sand Stream','The Pokémon summons a\nsandstorm in battle.','The weather changes to a sandstorm when this Pokémon enters battle and does not end unless cancelled by another weather condition.\n\nIf multiple Pokémon with this ability, drizzle, drought, or snow warning are sent out at the same time, the abilities will activate in order of Speed, respecting trick room.  Each ability\'s weather will cancel the previous weather, and only the weather summoned by the slowest of the Pokémon will stay.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in a sandstorm.'),(8,'sand-veil','Sand Veil','Boosts the Pokémon’s\nevasion in a sandstorm.','During a sandstorm, this Pokémon has 1.25× its evasion, and it does not take sandstorm damage regardless of type.\n\nThe evasion bonus does not count as a stat modifier.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in a sandstorm.'),(10019,'sandpit','Sandpit',NULL,NULL),(157,'sap-sipper','Sap Sipper','Boosts the Attack stat when hit\nby a Grass-type move.','Whenever a grass-type move hits this Pokémon, its Attack rises one stage, negating any other effect on it.'),(113,'scrappy','Scrappy','Makes Normal- and Fighting-type\nmoves hit Ghost-type Pokémon.','This Pokémon ignores ghost-type Pokémon\'s immunity to normal- and fighting-type moves.\n\nGhost Pokémon\'s other types affect damage as usual.'),(10033,'sequence','Sequence',NULL,NULL),(32,'serene-grace','Serene Grace','Boosts the likelihood of\nadditional effects occurring.','This Pokémon\'s moves have twice their usual effect chance.\n\nAn effect chance is a move\'s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move\'s main effect.  For example, flamethrower\'s chance of burning the target is doubled, but protect\'s chance of success and air cutter\'s increased critical hit rate are unaffected.\n\nsecret power is unaffected.'),(10058,'shackle','Shackle',NULL,NULL),(10049,'shadow-dash','Shadow Dash',NULL,NULL),(23,'shadow-tag','Shadow Tag','Prevents opposing Pokémon\nfrom escaping.','While this Pokémon is in battle, opposing Pokémon cannot flee or switch out.\n\nOther Pokémon with this ability are unaffected.  Pokémon with run away can still flee.  Pokémon can still switch out with the use of a move or item.'),(10047,'share','Share',NULL,NULL),(61,'shed-skin','Shed Skin','The Pokémon may heal its\nown status conditions.','After each turn, this Pokémon has a 33% of being cured of any major status ailment.'),(125,'sheer-force','Sheer Force','Removes additional effects to\nincrease move damage.','This Pokémon\'s moves with extra effects have 1.3× their power, but lose their extra effects.\n\nAn effect chance is a move\'s chance to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move\'s main effect. For example, thunder shock\'s paralysis is an extra effect, but thunder wave\'s is not, nor are knock off\'s item removal and air cutter\'s increased critical hit rate.\n\nMoves that lower the user\'s stats are unaffected.'),(75,'shell-armor','Shell Armor','Protects the Pokémon\nfrom critical hits.','Moves cannot score critical hits against this Pokémon.\n\nThis ability functions identically to battle armor.'),(10060,'shield','Shield',NULL,NULL),(19,'shield-dust','Shield Dust','Blocks the additional effects\nof attacks taken.','This Pokémon is immune to the extra effects of moves used against it.\n\nAn extra effect is a move\'s chance, listed as an \"effect chance\", to inflict a status ailment, cause a stat change, or make the target flinch in addition to the move\'s main effect.  For example, thunder shock\'s paralysis is an extra effect, but thunder wave\'s is not, nor are knock off\'s item removal and air cutter\'s increased critical hit rate.'),(86,'simple','Simple','The Pokémon is prone to\nwild stat changes.','Each stage of this Pokémon\'s stat modifiers acts as two stages.  These doubled stages are still limited to a minimum of -6 and a maximum of 6.\n\nThis Pokémon can still accumulate less than -3 or more than 3 stages of stat modifiers, even though the extra ones have no effect after doubling.'),(10003,'skater','Skater',NULL,NULL),(92,'skill-link','Skill Link','Increases the number of times\nmulti-strike moves hit.','This Pokémon always hits five times with two-to-five-hit moves, such as icicle spear.  It also bypasses the accuracy checks on triple kick\'s second and third hits.'),(112,'slow-start','Slow Start','Temporarily halves the Pokémon’s\nAttack and Speed stats.','This Pokémon\'s Attack and Speed are halved for five turns upon entering battle.\n\nThis ability also takes effect when acquired during battle.  If this Pokémon loses its ability before the five turns are up, its Attack and Speed return to normal; if it then regains this ability without leaving battle, its Attack and Speed are halved again, but the counter keeps counting from where it was.'),(97,'sniper','Sniper','Powers up moves if they\nbecome critical hits.','This Pokémon inflicts triple damage with critical hits, rather than the usual double damage.'),(81,'snow-cloak','Snow Cloak','Boosts evasion in a\nhailstorm.','During hail, this Pokémon has 1.25× its evasion, and it does not take hail damage regardless of type.\n\nThe evasion bonus does not count as a stat modifier.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved in snow.'),(117,'snow-warning','Snow Warning','The Pokémon summons a\nhailstorm when it enters a battle.','The weather changes to hail when this Pokémon enters battle and does not end unless 