on with this ability will move in reverse order of Speed after Pokémon without it.'),(176,'stance-change','Stance Change','The Pokémon changes form\ndepending on how it battles.','Changes aegislash to Blade Forme before using a damaging move, or Shield Forme before using kings shield.'),(9,'static','Static','Contact with the Pokémon\nmay cause paralysis.','Whenever a move makes contact with this Pokémon, the move\'s user has a 30% chance of being paralyzed.\n\nPokémon that are immune to electric-type moves can still be paralyzed by this ability.\n\nOverworld: If the lead Pokémon has this ability, there is a 50% chance that encounters will be with an electric Pokémon, if applicable.'),(80,'steadfast','Steadfast','Boosts the Speed stat each time\nthe Pokémon flinches.','Whenever this Pokémon flinches, its Speed rises one stage.'),(10030,'stealth','Stealth',NULL,NULL),(1,'stench','Stench','The stench may cause\nthe target to flinch.','This Pokémon\'s damaging moves have a 10% chance to make the target flinch with each hit if they do not already cause flinching as a secondary effect.\n\nThis ability does not stack with a held item.\n\nOverworld: The wild encounter rate is halved while this Pokémon is first in the party.'),(60,'sticky-hold','Sticky Hold','Protects the Pokémon\nfrom item theft.','This Pokémon\'s hold item cannot be removed by other Pokémon.\n\nDamaging moves that would remove this Pokémon\'s item can still inflict damage against this Pokémon, e.g. knock off or pluck.  This Pokémon can still use moves that involve the loss of its own item, e.g. fling or trick.\n\nOverworld: If the lead Pokémon has this ability, the encounter rate while fishing is increased.'),(114,'storm-drain','Storm Drain','Draws in all Water-type moves\nto boost its Sp. Atk stat.','All other Pokémon\'s single-target water-type moves are redirected to this Pokémon, if it is an eligible target.  Other Pokémon\'s Water moves raise this Pokémon\'s Special Attack one stage, negating any other effect on it, and cannot miss it.\n\nIf the move\'s intended target also has this ability, the move is not redirected.  When multiple Pokémon with this ability are possible targets for redirection, the move is redirected to the one with the highest Speed stat, or, in the case of a tie, to a random tied Pokémon.  follow me takes precedence over this ability.'),(173,'strong-jaw','Strong Jaw','The Pokémon’s strong jaw gives\nit tremendous biting power.','Strengthens biting moves to 1.5× their power.'),(5,'sturdy','Sturdy','It cannot be knocked\nout with one hit.','When this Pokémon is at full HP, any hit that would knock it out will instead leave it with 1 HP.  Regardless of its current HP, it is also immune to the one-hit KO moves: fissure, guillotine, horn drill, and sheer cold.\n\nIf this Pokémon is holding a focus sash, this ability takes precedence and the item will not be consumed.'),(21,'suction-cups','Suction Cups','Negates all moves and items\nthat force switching out.','This Pokémon cannot be forced out of battle by moves such as whirlwind.\n\ndragon tail and circle throw still inflict damage against this Pokémon.\n\nOverworld: If the lead Pokémon has this ability, the success rate while fishing is increased.'),(105,'super-luck','Super Luck','Boosts the critical-hit\nratios of moves.','This Pokémon\'s moves have critical hit rates one stage higher than normal.'),(68,'swarm','Swarm','Powers up Bug-type moves when\nthe Pokémon is in trouble.','When this Pokémon has 1/3 or less of its HP remaining, its bug-type moves inflict 1.5× as much regular damage.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is increased.'),(175,'sweet-veil','Sweet Veil','Prevents itself and ally Pokémon\nfrom falling asleep.','Prevents friendly Pokémon from sleeping.'),(33,'swift-swim','Swift Swim','Boosts the Pokémon’s\nSpeed stat in rain.','This Pokémon\'s Speed is doubled during rain.\n\nThis bonus does not count as a stat modifier.'),(180,'symbiosis','Symbiosis','The Pokémon can pass\nan item to an ally.','Passes the bearer\'s held item to an ally when the ally uses up its item.'),(28,'synchronize','Synchronize','Passes poison, paralyze, or burn\nto the Pokémon that inflicted it.','Whenever this Pokémon is burned, paralyzed, or poisoned, the Pokémon who gave this Pokémon that ailment is also given the ailment.\n\nThis ability passes back bad poison when this Pokémon is badly poisoned.  This ability cannot pass on a status ailment that the Pokémon did not directly receive from another Pokémon, such as the poison from toxic spikes or the burn from a flame orb.\n\nOverworld: If the lead Pokémon has this ability, wild Pokémon have a 50% chance of having the lead Pokémon\'s nature, and a 50% chance of being given a random nature as usual, including the lead Pokémon\'s nature.  This does not work on Pokémon received outside of battle or roaming legendaries.'),(77,'tangled-feet','Tangled Feet','Raises evasion if the\nPokémon is confused.','When this Pokémon is confused, it has twice its evasion.'),(101,'technician','Technician','Powers up the Pokémon’s\nweaker moves.','This Pokémon\'s moves have 1.5× their power if their base power is 60 or less.\n\nThis includes moves of variable power, such as hidden power and magnitude, when their power is 60 or less.  helping hand\'s power boost is taken into account for any move, as is defense curl\'s power boost for rollout.'),(140,'telepathy','Telepathy','Anticipates an ally’s\nattack and dodges it.','This Pokémon does not take damage from friendly Pokémon\'s moves, including single-target moves aimed at it.'),(10011,'tenacity','Tenacity',NULL,NULL),(164,'teravolt','Teravolt','Moves can be used on the target\nregardless of its Abilities.','This Pokémon\'s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon\'s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon\'s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move\'s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon\'s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon\'s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to mold breaker and turboblaze.'),(47,'thick-fat','Thick Fat','Boosts resistance to Fire-​\nand Ice-type moves.','This Pokémon takes half as much damage from fire- and ice-type moves.'),(10004,'thrust','Thrust',NULL,NULL),(110,'tinted-lens','Tinted Lens','Powers up “not very\neffective” moves.','This Pokémon deals twice as much damage with moves that are not very effective against the target.'),(67,'torrent','Torrent','Powers up Water-type moves\nwhen the Pokémon is in trouble.','When this Pokémon has 1/3 or less of its HP remaining, its water-type moves inflict 1.5× as much regular damage.'),(181,'tough-claws','Tough Claws','Powers up moves that\nmake direct contact.','Strengthens moves that make contact to 1.33× their power.'),(137,'toxic-boost','Toxic Boost','Powers up physical attacks when\nthe Pokémon is poisoned.','This Pokémon has 1.5× its Attack when poisoned.'),(36,'trace','Trace','The Pokémon copies an\nopposing Pokémon’s Ability.','When this Pokémon enters battle, it copies a random opponent\'s ability.\n\nThis ability cannot copy flower gift, forecast, illusion, imposter, multitype, trace, wonder guard, or zen mode.'),(54,'truant','Truant','The Pokémon can’t attack\non consecutive turns.','Every second turn on which this Pokémon should attempt to use a move, it will instead do nothing (\"loaf around\").\n\nLoafing around interrupts moves that take multiple turns the same way paralysis, flinching, etc do.  Most such moves, for example bide or rollout, are simply cut off upon loafing around.  Attacks with a recharge turn, such as hyper beam, do not have to recharge; attacks with a preparation turn, such as fly, do not end up being used.  Moves that are forced over multiple turns and keep going through failure, such as outrage, uproar, or any move forced by encore, keep going as usual.\n\nIf this Pokémon is confused, its confusion is not checked when loafing around; the Pokémon cannot hurt itself, and its confusion does not end or come closer to ending.\n\nIf this Pokémon attempts to move but fails, e.g. because of paralysis or gravity, it still counts as having moved and will loaf around the next turn.  If it does not attempt to move, e.g. because it is asleep or frozen, whatever it would have done will be postponed until its next attempt; that is, it will either loaf around or move as usual, depending on what it last did.\n\nThis ability cannot be changed with worry seed, but it can be disabled with gastro acid, changed with role play, or traded away with skill swap.'),(163,'turboblaze','Turboblaze','Moves can be used on the target\nregardless of its Abilities.','This Pokémon\'s moves completely ignore abilities that could hinder or prevent their effect on the target.\n\nFor example, this Pokémon\'s moves ignore abilities that would fully negate them, such as water absorb; abilities that would prevent any of their effects, such as clear body, shell armor, or sticky hold; and abilities that grant any general protective benefit, such as simple, snow cloak, or thick fat.  If an ability could either hinder or help this Pokémon\'s moves, e.g. dry skin or unaware, the ability is ignored either way.\n\nAbilities that do not fit this description, even if they could hinder moves in some other way, are not affected.  For example, cursed body only affects potential future uses of the move, while liquid ooze and shadow tag can only hinder a move\'s effect on the user.  This ablity cannot ignore type or form changes granted by abilities, for example color change or forecast; nor effects that were caused by abilities but are no longer tied to an ability, such as the rain from drizzle.  This ability cannot ignore multitype at all.\n\nAn ability ignored by this ability is only nullified while the move is being used.  For example, this Pokémon\'s moves can paralyze a Pokémon with limber, but Limber will activate and heal the paralysis immediately thereafter, and this Pokémon\'s spikes are not affected by this ability after they have been placed.\n\nWhen this Pokémon enters battle, all participating trainers are notified that it has this ability.\n\nThis ability functions identically to mold breaker and teravolt.'),(109,'unaware','Unaware','Ignores the opposing\nPokémon’s stat changes.','This Pokémon ignores other Pokémon\'s stat modifiers for the purposes of damage and accuracy calculation.\n\nEffectively, this affects modifiers of every stat except Speed.\n\nThe power of punishment and stored power is calculated as usual.  When this Pokémon hurts itself in confusion, its stat modifiers affect damage as usual.'),(84,'unburden','Unburden','Boosts the Speed stat if its\nheld item is used or lost.','When this Pokémon uses or loses its held item, its Speed is doubled.  If it gains another item or leaves battle, this bonus is lost.\n\nThis includes when the Pokémon drops its item because of knock off.  This bonus does not count as a stat modifier.  There is no notification when this ability takes effect.'),(127,'unnerve','Unnerve','Unnerves opposing Pokémon and\nmakes them unable to eat Berries.','Opposing Pokémon cannot eat held Berries while this Pokémon is in battle.\n\nAffected Pokémon can still use bug bite or pluck to eat a target\'s Berry.'),(10031,'vanguard','Vanguard',NULL,NULL),(162,'victory-star','Victory Star','Boosts the accuracy of its\nallies and itself.','All friendly Pokémon\'s moves, including this Pokémon\'s own moves, have 1.1× their usual accuracy while this Pokémon is in battle.'),(72,'vital-spirit','Vital Spirit','Prevents the Pokémon\nfrom falling asleep.','This Pokémon cannot be asleep.\n\nThis causes rest to fail altogether.  If a Pokémon is asleep and acquires this ability, it will immediately wake up; this includes when regaining a lost ability upon leaving battle.\n\nThis ability functions identically to insomnia in battle.\n\nOverworld: If the lead Pokémon has this ability, higher-levelled Pokémon have their encounter rate increased.'),(10,'volt-absorb','Volt Absorb','Restores HP if hit by an\nElectric-type move.','Whenever an electric-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.\n\nThis ability will not take effect if this Pokémon is ground-type and thus immune to Electric moves.  Electric moves will ignore this Pokémon\'s substitute.\n\nThis effect includes non-damaging moves, i.e. thunder wave.'),(10016,'warm-blanket','Warm Blanket',NULL,NULL),(11,'water-absorb','Water Absorb','Restores HP if hit by a\nWater-type move.','Whenever a water-type move hits this Pokémon, it heals for 1/4 of its maximum HP, negating any other effect on it.\n\nWater moves will ignore this Pokémon\'s substitute.'),(41,'water-veil','Water Veil','Prevents the Pokémon\nfrom getting a burn.','This Pokémon cannot be burned.\n\nIf a Pokémon is burned and acquires this ability, its burn is healed; this includes when regaining a lost ability upon leaving battle.'),(10002,'wave-rider','Wave Rider',NULL,NULL),(133,'weak-armor','Weak Armor','Physical attacks lower its Defense\nstat and raise its Speed stat.','Whenever a physical move hits this Pokémon, its Speed rises one stage and its Defense falls one stage.\n\nThis ability triggers on every hit of a multiple-hit move.'),(73,'white-smoke','White Smoke','Prevents other Pokémon\nfrom lowering its stats.','This Pokémon cannot have its stats lowered by other Pokémon.\n\nThis ability does not prevent any stat losses other than stat modifiers, such as the Speed cut from paralysis; nor self-inflicted stat drops, such as the Special Attack drop from overheat; nor opponent-triggered stat boosts, such as the Attack boost from swagger.  This Pokémon can still be passed negative stat modifiers through guard swap, heart swap, or power swap.\n\nThis ability functions identically to clear body in battle.\n\nOverworld: If the lead Pokémon has this ability, the wild encounter rate is halved.'),(25,'wonder-guard','Wonder Guard','Only supereffective\nmoves will hit.','This Pokémon is immune to damaging moves that are not super effective against it.\n\nMoves that inflict fixed damage, such as night shade or seismic toss, are considered super effective if their types are.  Damage not directly dealt by moves, such as damage from weather, a status ailment, or spikes, is not prevented.\n\nThis ability cannot be copied with role play or traded away with skill swap, but it can be copied with trace, disabled with gastro acid, or changed with worry seed.  This Pokémon can still use Role Play itself to lose this ability, but not Skill Swap.\n\nIf this Pokémon has a substitute, this ability will block moves as usual and any moves not blocked will react to the Substitute as usual.'),(147,'wonder-skin','Wonder Skin','Makes status moves\nmore likely to miss.','Non-damaging moves have exactly 50% base accuracy against this Pokémon.'),(161,'zen-mode','Zen Mode','Changes the Pokémon’s\nshape when HP is half or less.','This Pokémon switches between Standard Mode and Zen Mode after each turn depending on its HP.  Below 50% of its maximum HP, it switches to Zen Mode, and at 50% or above, it switches to Standard Mode.\n\nThis Pokémon returns to Standard Mode upon leaving battle or losing this ability.  This ability has no effect if this Pokémon is not a darmanitan.');
