DROP TABLE IF EXISTS `pokemon_base`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pokemon_base` (
  `id` int(11) NOT NULL,
  `name` varchar(45) NOT NULL,
  `hp` int(11) DEFAULT NULL,
  `attack` int(11) DEFAULT NULL,
  `defense` int(11) DEFAULT NULL,
  `special_attack` int(11) DEFAULT NULL,
  `special_defense` int(11) DEFAULT NULL,
  `speed` int(11) DEFAULT NULL,
  `experience` int(11) DEFAULT NULL,
  `weight` int(11) DEFAULT NULL,
  `height` int(11) DEFAULT NULL,
  `ability_1` varchar(45) DEFAULT NULL,
  `ability_2` varchar(45) DEFAULT NULL,
  `ability_3` varchar(45) DEFAULT NULL,
  `type_1` varchar(45) DEFAULT NULL,
  `type_2` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`name`),
  KEY `fk_pokemon_ability1_idx` (`ability_1`),
  KEY `fk_pokemon_ability2_idx` (`ability_2`),
  KEY `fk_pokemon_ability3_idx` (`ability_3`),
  KEY `fk_pokemon_type1_idx` (`type_1`),
  KEY `fk_pokemon_type2_idx` (`type_2`),
  CONSTRAINT `fk_pokemon_ability1` FOREIGN KEY (`ability_1`) REFERENCES `pokemon_ability` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pokemon_ability2` FOREIGN KEY (`ability_2`) REFERENCES `pokemon_ability` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pokemon_ability3` FOREIGN KEY (`ability_3`) REFERENCES `pokemon_ability` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pokemon_type1` FOREIGN KEY (`type_1`) REFERENCES `pokemon_type` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pokemon_type2` FOREIGN KEY (`type_2`) REFERENCES `pokemon_type` (`name`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

